from typing import List

class Solution:
    def minOperations(self, nums1: List[int], nums2: List[int]) -> int:
        swap_count = 0
        n = len(nums1)

        # Checking if swapping is needed at all
        if nums1[n-1] == max(nums1) and nums2[n-1] == max(nums2):
            return 0

        for i in range(n):
            if (i == n-1) or (nums1[i] == max(nums1) and nums2[i] == max(nums2)):
                # If both maximum are already at the last position or being moved to the last position
                if nums1[n-1] < nums2[i]:
                    nums1[n-1], nums2[i] = nums2[i], nums1[n-1]
                    swap_count += 1
                elif nums2[n-1] < nums1[i]:
                    nums1[i], nums2[i] = nums2[i], nums1[i]
                    swap_count += 1
                break

        if nums1[n-1] != max(nums1) or nums2[n-1] != max(nums2):
            return -1  # It's not possible to satisfy the condition

        return swap_count
